import React from 'react';
import loading from './logoloading.gif';

export default () => {
   return (
      <div className='loading flex--center flex--wrap'>
         <p className='loading__text flex--center '>
            <img
               src={loading}
               alt='Loading...'
               style={{ width: '150px', margin: '10px auto', display: 'block' }}
            />
            <p></p>
            Loading..
         </p>
      </div>
   );
};
